// src/utils/PlaySound.ts
import useSound from 'use-sound';

// Define sound file paths
const SOUNDS = {
  alert: 'data:audio/mpeg;base64,',
  success: '/sounds/success.mp3',
};

// Export a simple function to play sounds without hooks
export const playSound = (soundName: keyof typeof SOUNDS) => {
  const audio = new Audio(SOUNDS[soundName]);
  audio.play().catch(error => {
    console.log('Sound play failed:', error);
  });
};

// Export a hook for components that need more control
export const usePlaySound = () => {
  const [playAlert] = useSound(SOUNDS.alert);
  const [playSuccess] = useSound(SOUNDS.success);

  return {
    playAlert,
    playSuccess,
  };
};